CREATE TABLE dtks_data (
    `id` int AUTO_INCREMENT PRIMARY KEY,
    `kec` VARCHAR(255) CHARACTER SET utf8,
    `desa` VARCHAR(255) CHARACTER SET utf8,
    `alamat` VARCHAR(255) CHARACTER SET utf8,
    `nik` BIGINT,
    `nkk` BIGINT,
    `nama_krt` VARCHAR(255) CHARACTER SET utf8,
    `tgl_lahir` DATETIME,
    `id_dtks` VARCHAR(16),
    `jml_kel` INT,
    `jml_art` INT,
    `rt` INT,
    `rw` INT,
    `verivalinama` VARCHAR(255) CHARACTER SET utf8,
    `rmh_depan` VARCHAR(255),
    `rmh_belakang` VARCHAR(255),
    `rmh_kiri` VARCHAR(255),
    `rmh_kanan` VARCHAR(255),
    `peristiwa` VARCHAR(255) CHARACTER SET utf8,
    `tgl_peristiwa` DATETIME,
    `status` INT,
    `created_at` DATETIME,
    `updated_at` DATETIME);
